INSERT INTO `w_article` VALUES ('508', '101', null, 'Ross: I just feel like someone reached down my throat, grabbed my small intestine, pulled it out of my mouth and tied it around my neck...\r\n\r\nChandler: Cookie?\r\n\r\nMonica: Carol moved her stuff out today. \r\n\r\nJoey: Ohh.\r\n\r\nMonica: Let me get you some coffee.\r\n\r\nRoss: Thanks.\r\n\r\nPhoebe: Ooh! Oh! \r\n\r\nRoss: No, no don\'t! Stop cleansing my aura! No, just leave my aura alone, okay?\r\n\r\nPhoebe: Fine!  Be murky!\r\n\r\nRoss: I\'ll be fine, alright? Really, everyone. I hope she\'ll be very happy.\r\n\r\nMonica: No you don\'t.\r\n\r\nRoss: No I don\'t, to hell with her, she left me!\r\n\r\nJoey: And you never knew she was a lesbian...\r\n\r\nRoss: No!! Okay?! Why does everyone keep fixating on that? She didn\'t know, how should I know?\r\n\r\nChandler: Sometimes I wish I was a lesbian...  Did I say that out loud?\r\n\r\nRoss: I told mom and dad last night, they seemed to take it pretty well.\r\n\r\nMonica: Oh really, so that hysterical phone call I got from a woman at sobbing 3:00 A.M., ', '1', '105', null, null, null, null);
